    true,nt"url": null,nt"notes": "Mutual solubilities and liquid-liquid equilibria
    of binary, ternary and quaternary systems are presented. Typical solvents and solutes
    include water, sea water, heavy water, inorganic compounds, and a variety of organic
    compounds such as hydrocarbons, halogenated hydrocarbons, alcohols, acids, esters
    and nitrogen compounds. For many systems, sufficient data were available to allow
    critical evaluation. Data are expressed as mass and mole fractions as well as the
    originally reported units.   There are over 67,500 solubility measurements, compiled
    from 18 volumes of the IUPAC Solubility Data Series. .  Version 1.0",nt"license_title":
